import CreateWishListForm from "../CreateReadForm";
import { useContext } from 'react';
import { UserContext } from "../../App";

const WishList = () => {
   const userContext = useContext(UserContext);

      return (
          <div>
            <CreateWishListForm />
                {!userContext.user ? <h2>wish Not logged in</h2> : 
                    userContext.user.wishList.map((book) => {
                        return (
                            <div key={book._id}>
                                <h2>{book.title}</h2>
                                <h3>{book.author}</h3>
                            </div>
                        )
                    })

                }    
            </div>
      )
}

export default WishList;
